import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { DropdownButton, Dropdown } from 'react-bootstrap';
import { Link } from 'react-router-dom';

const Targets = () => {
  const handleSelect1 = (eventKey) => {
    // Handle the selected item here if needed
    console.log(`Item with event key "${eventKey}" selected.`);
  };

  return (
    <div
      className="container-fluid bg-secondary d-flex justify-content-center align-items-center"
      role="group"
      aria-label="Button group with nested dropdown"
      style={{ height: '90vh' }}
    >
    <div class="dropdown">
      <button class="btn btn-danger dropdown-toggle" type="button" data-bs-toggle="dropdown" aria-expanded="false">
        Select a target.
      </button>
      <ul class="dropdown-menu">
        <li><a class="dropdown-item" href="#">Davis</a></li>
        <li><a class="dropdown-item" href="#">Another action</a></li>
        <li><a class="dropdown-item" href="#">Something else here</a></li>
      </ul>
    </div>
    </div>
  );
};

export default Targets;
